    data: |
      SELECT ALL - col0 + col1 FROM tab2 (FORMAT parquet) WHERE - col1 + + + col1 * 9 + + col1 - col2 IS NOT NULL AND NOT ( NULL ) IS NULL;
  - name: tab2

outputs:
  - name: q12355.out
    data: |
